  <script>
    const img = document.getElementById("zoomImg");
    let scale = 1, panX = 0, panY = 0;
    let isPanning = false, startX = 0, startY = 0;

    // Apply current transform
    function updateTransform() {
      img.style.transform = `translate(${panX}px, ${panY}px) scale(${scale})`;
    }

    // Wheel to zoom, pointer-centered
    img.onwheel = function(e) {
      e.preventDefault();
      const rect = img.getBoundingClientRect();
      const offsetX = e.clientX - rect.left;
      const offsetY = e.clientY - rect.top;
      img.style.transformOrigin = `${(offsetX/rect.width)*100}% ${(offsetY/rect.height)*100}%`;

      scale += e.deltaY * -0.002;
      scale = Math.min(Math.max(0.5, scale), 10);
      updateTransform();
    };

    // Mouse down to start panning
    img.onmousedown = function(e) {
      e.preventDefault();
      isPanning = true;
      startX = e.clientX - panX;
      startY = e.clientY - panY;
      img.style.cursor = 'grabbing';
    };

    // Mouse move to pan
    window.onmousemove = function(e) {
      if (!isPanning) return;
      panX = e.clientX - startX;
      panY = e.clientY - startY;
      updateTransform();
    };

    // Stop panning on up or leave
    window.onmouseup = window.onmouseleave = function() {
      isPanning = false;
      img.style.cursor = 'grab';
    };

    // Prevent image drag ghost
    img.ondragstart = () => false;
  </script>
